classdef Robot_operator % 6dof robot arm
    properties 
        m_status = []; % trajectory information 
        
        m_DH = []; % total DH parameter
        m_DH_cam = []; % camera DH parameter
        m_q =[]; % joint angle 
        m_q_offset = []; % offset for arduino
        m_q_ardu = []; %joint angle in arduino

        m_T_init = []; % initial tf 4x4
        m_T_b = []; % base coordinate 4x4
        m_T = []; % current tf 4x4
        m_T_cam = []; % camera transformation 4x4
        
        m_targ = []; % target transformation 4x4
        m_targ_f = [];
            
        m_Robot = []; % robot kinematic model
        m_Cconfig = []; % robot configuration

    end
    methods 
        %% define
        function obj = Robot_operator(robot,Cconfig,T_base,q,q_off) % T_base :4x4mat  q: 6x1vec
            obj.m_q = q;
            obj.m_q_offset = q_off;
            obj.m_Robot = robot;
            obj.m_Cconfig = Cconfig;
            if isempty(T_base)
                obj.m_T_b = DH_mat([0.381,0,0,0]);
            else
                obj.m_T_b = T_base;
            end

            [obj.m_T_init, obj.m_T_cam, obj.m_q, obj.m_q_ardu] = update_pose(obj,obj.m_q);
            [obj.m_T, obj.m_T_cam, obj.m_q, obj.m_q_ardu] = update_pose(obj,obj.m_q);
        end
        %% visualize robot 
        function obj = robot_vis(obj) % end_effecotr = 1 or 0
%             if end_effector==1
                
            % current TF
            ctform = obj.m_T;
            curr_axis_x = drawAxis(ctform(1,4),ctform(1,4)+ctform(1,1),ctform(2,4),ctform(2,4)+ctform(2,1),ctform(3,4),ctform(3,4)+ctform(3,1));
            curr_axis_y = drawAxis(ctform(1,4),ctform(1,4)+ctform(1,2),ctform(2,4),ctform(2,4)+ctform(2,2),ctform(3,4),ctform(3,4)+ctform(3,2));
            curr_axis_z = drawAxis(ctform(1,4),ctform(1,4)+ctform(1,3),ctform(2,4),ctform(2,4)+ctform(2,3),ctform(3,4),ctform(3,4)+ctform(3,3));
            
            plot3(curr_axis_x(1,:),curr_axis_x(2,:),curr_axis_x(3,:),'r.');
            hold on 
            plot3(curr_axis_y(1,:),curr_axis_y(2,:),curr_axis_y(3,:),'g.');
            hold on 
            plot3(curr_axis_z(1,:),curr_axis_z(2,:),curr_axis_z(3,:),'b.');
            hold on 
%             end
            for i = 1:6
                obj.m_Cconfig(i).JointPosition = obj.m_q(i);
            end
            show(obj.m_Robot,obj.m_Cconfig);
%             hold on
%             pause(0.00001);
%             hold off
            
            
        end
        %% visualize target
        function obj = target_vis(obj,tem_targ, final_target)
            if tem_targ==1
                ttform = obj.m_targ; % current trjectory target TF
                targ_axis_x = drawAxis(ttform(1,4),ttform(1,4)+ttform(1,1),ttform(2,4),ttform(2,4)+ttform(2,1),ttform(3,4),ttform(3,4)+ttform(3,1));
                targ_axis_y = drawAxis(ttform(1,4),ttform(1,4)+ttform(1,2),ttform(2,4),ttform(2,4)+ttform(2,2),ttform(3,4),ttform(3,4)+ttform(3,2));
                targ_axis_z = drawAxis(ttform(1,4),ttform(1,4)+ttform(1,3),ttform(2,4),ttform(2,4)+ttform(2,3),ttform(3,4),ttform(3,4)+ttform(3,3));
    
                txt = 'target current';
                text(ttform(1,4),ttform(2,4), ttform(3,4),txt);
                hold on 
                plot3(targ_axis_x(1,:),targ_axis_x(2,:),targ_axis_x(3,:),'r.');
                hold on 
                plot3(targ_axis_y(1,:),targ_axis_y(2,:),targ_axis_y(3,:),'g.');
                hold on 
                plot3(targ_axis_z(1,:),targ_axis_z(2,:),targ_axis_z(3,:),'b.');
                hold on 
            end
            if final_target ==1
                ttform_f = obj.m_targ_f; % final trajectory target TF_f
                ftarg_axis_x = drawAxis(ttform_f(1,4),ttform_f(1,4)+ttform_f(1,1),ttform_f(2,4),ttform_f(2,4)+ttform_f(2,1),ttform_f(3,4),ttform_f(3,4)+ttform_f(3,1));
                ftarg_axis_y = drawAxis(ttform_f(1,4),ttform_f(1,4)+ttform_f(1,2),ttform_f(2,4),ttform_f(2,4)+ttform_f(2,2),ttform_f(3,4),ttform_f(3,4)+ttform_f(3,2));
                ftarg_axis_z = drawAxis(ttform_f(1,4),ttform_f(1,4)+ttform_f(1,3),ttform_f(2,4),ttform_f(2,4)+ttform_f(2,3),ttform_f(3,4),ttform_f(3,4)+ttform_f(3,3));
    
                txt2 = 'target final';
                text(ttform_f(1,4),ttform_f(2,4), ttform_f(3,4),txt2);
                hold on 
                plot3(ftarg_axis_x(1,:),ftarg_axis_x(2,:),ftarg_axis_x(3,:),'r.');
                hold on 
                plot3(ftarg_axis_y(1,:),ftarg_axis_y(2,:),ftarg_axis_y(3,:),'g.');
                hold on 
                plot3(ftarg_axis_z(1,:),ftarg_axis_z(2,:),ftarg_axis_z(3,:),'b.');
                hold on 
            end
            xlabel('X-axis');
            ylabel('Y-axis');
            zlabel('Z-axis');

            hold on
            pause(0.00001);
            hold off
        end
        
