                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          1];
            
        end

        
        %% orientation error
        function [e4, e5, e6] = calc_OE(obj,tempO,curr_O)
            targ_O = tempO;
%             curr_O = obj.m_T(1:3,1:3);
            targetori = targ_O*curr_O.';
            targetori = targetori - targetori.';
            
            e4 = targetori(3,2);
            e5 = targetori(1,3);
            e6 = targetori(2,1);
        end
        
        %% position error
        function [e1,e2,e3] = calc_PE(obj,tempP,curr_P)
            targ_P = tempP; 
%             curr_P = obj.m_T(1:3,4);
            e1 = targ_P(1) - curr_P(1);
            e2 = targ_P(2) - curr_P(2);
            e3 = targ_P(3) - curr_P(3);
        end
        
        %% Rotation axis and angle
        function [Nv, th1, Rv, th2, temp_Ori] = calc_Rot(obj)
            targ_O = obj.m_targ(1:3,1:3);
            curr_O = obj.m_T(1:3,1:3);
            th1 = acos(dot(targ_O(1:3,3),curr_O(1:3,3))); % noa a    
            Nv = cross(curr_O(1:3,3),targ_O(1:3,3)); %z  cross product
            if norm(Nv)<0.001
                Nv = Nv;
            else
                Nv = Nv / norm(Nv);
            end
            rodri1 = Rodrigues(Nv,th1); %z   
            temp_Ori = rodri1 * curr_O(1:3,1:3);
            th2 = acos(dot(targ_O(1:3,2),temp_Ori(1:3,2)));
            Rv = cross(temp_Ori(1:3,2), targ_O(1:3,2));
            if norm(Rv)<0.001
                Rv = Rv;
            else
                Rv = Rv / norm(Rv);
            end
        end

        %% path check
        function [target,d_target] = PathCheck(obj,Tf,Ti,time) % F : 3x1, I: 3x1
            F = obj.m_targ(1:3,4); I = obj.m_T(1:3,4);
            linear_Point = I + (I - F) * (cos(pi / (Tf - Ti) * (time - Ti)) - 1) * 0.5; % path planning
            if(time<Tf)
                target = linear_Point;
                d_target = 0.5 * (F - I) * pi / (Tf - Ti) * sin(pi / (Tf - Ti) * (time - Ti)); % linear Point 
            else
                target = F;
                d_target = [0 0 0];
            end
            
        end
        
        function theta = RotCheck(obj,F, Tf,Ti,time)            
            
            if(time<Tf)
                theta = (- F) * 0.5 * (cos(pi / (Tf - Ti) * (time - Ti)) - 1);%0~F~0
            else
                theta = F;
            end

        end
    end
end


%% joint angle calculation in arduino
function q_arduino = Q_Ardu(q,q_off) % 7x1
    q_arduino = rad2deg([q(1);q(2);q(2);q(3);q(4);q(5);q(6);]);
    q_arduino = q_arduino + q_off;
end
%% DH2Tform
function T = DH_mat(x)
    d = x(1);
    theta = x(2);
    a = x(3);
    alpha = x(4);
    
    T = zeros(4,4);
    T(4,4) = 1;
    
    T = sym(T);
    T(1,1) = cos(theta);    T(1,2) = -sin(theta)*cos(alpha);    T(1,3) = sin(theta)*sin(alpha); T(1,4) = a*cos(theta);
    T(2,1) = sin(theta);    T(2,2) = cos(theta)*cos(alpha); T(2,3) = -cos(theta)*sin(alpha);    T(2,4) = a*sin(theta);
    T(3,2) = sin(alpha);    T(3,3) = cos(alpha);    T(3,4) = d;

end

%% calculate Tform based on kinematic model

function t_axis_x = drawAxis(start_x_1,end_x_1,start_x_2,end_x_2,start_x_3,end_x_3)
    x_1 = linspace(start_x_1,end_x_1,100);
    x_2 = linspace(start_x_2,end_x_2,100);
    x_3 = linspace(start_x_3,end_x_3,100);
    t_axis_x = [x_1;x_2;x_3];
end
